import style from './About.module.css'

const About = () => {
    return(
        <div className={style.container}>
            <div className={style.pContainer}>
                <p className={style.pAbout}>
                    I am a Full Stack Web developer with experience building websites and web applications. I specialize in JavaScript and have experience working with React.js, Redux.js, Node.js, Express.js, Sequelize.js, Postgre and GitHub.
                </p>
            </div>
        </div>
    )
}

export default About;
